import React from 'react';
import LoggedInNavigation from "./LoggedInNavigation";
import {Row, Col, Container} from "react-bootstrap";

const Profile = () => {
  return (
    <>
    <LoggedInNavigation />
    <Container>
        <Row>
            <Col>
            <div className="user">
                <div style={{backgroundColor: grey, borderRadius: 50, width: 80, height: 80}}/>
            </div>
            </Col>
            </Row>
        </Container>
    </>
  )
}

export default Profile
